import './Login.css';


export default class Login extends Component {


   

    render () {
        const {name} = this.props;
        let {userName} ='';
        let {userPass} ='';
        return(
            <div className = "Login">
                <input type = "text" placeholder= "User Name" value = {userName} />
                <input type = "password" placeholder="password" value ={userPass} />
                <button name = "Login" onClick = {() => this.checkLogin(userName, userPass, name)}/>
            </div>
        )
    }



    checkLogin(userName, userPass, name){
        name.map((loginUser) => {
            debugger;
            if(userName === loginUser.loginName  ){
                 console.log("success")
            }
          
            if(userName !== loginUser.loginName){
                console.log("faild")
            }
        }) 

    
     }
}
